import * as React from 'react';
import { Image, StyleSheet, Text, View, StatusBar, FlatList, SafeAreaView, IconComponent, tabBarIcon, TouchableOpacity, Dimensions, ScrollView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';

import SearchBox from './src/screenComponents/SearchBox';


const styleSheet = StyleSheet.create
(
  {
  MainContainer: {
    flex: 1,
  },
  listItem: {
    paddingLeft: 12,
    paddingTop: 10,
    paddingBottom: 10,
  },
  itemText: {
    fontSize: 24,
    color: 'black',
    fontFamily: 'Cochin',
  },
  activityIndicator: {
    position: 'absolute',
    alignItems: 'center',
    justifyContent: 'center',
    left: 0,
    right: 0,
    top: 0,
    bottom: 0,
  }
  }
);

//WYSWIETLANIE ZDJEC
function Feed() 
{
  const [data, setData] = React.useState([])
  React.useEffect(() => 
  {
    fetch("https://jsonplaceholder.typicode.com/photos")
      .then((res) => res.json())
      .then((response) => 
      {
        setData(response)
      })
      .catch((error) => 
      {
        console.log(error)
      })
  }, [])

  const renderItem = ({ item }) => 
  {
    console.log(item)
    return (
      <View style={{ flex: 1, flexDirection: "row" }}>
        <Image style={{ height: 300, width: 420 }} source={{ uri: item.url }} />
        <Text style={{ fontSize: 24, color: 'black' }} source={{ uri: item.title}} />
      </View>
    )
  }

  return (
    <SafeAreaView style={styleSheet.MainContainer}>
          <FlatList 
            data={data} renderItem={renderItem}
            />
    </SafeAreaView>
  )
}
//KONIEC

//OPCJONALNY TAB Z ZADANIE 5 !
function Profile() 
{
  return 
  (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>POPROSZE 5 ðŸ˜ƒ</Text>
    </View>
  );
}
//KONIEC

//WKLADKA WYSZUKIWARKI
function Search() 
{
  return (
    <View
      style={{
        width: '100%',
        height: '100%',
        backgroundColor: 'white',
        position: 'relative',
      }}>

        <SearchBox />
        </View>
  );
}
//KONIEC

//ORGANIZACJA TAB'OW
const Tab = createBottomTabNavigator();

function MyTabs() 
{
  return (
    <Tab.Navigator

      initialRouteName="Feed"
      screenOptions=
      {{
        tabBarActiveTintColor: '#e91e63',
      }}
    >
      <Tab.Screen

        name="Instasia"
        component={Feed}
        options={{ 
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="home" color={color} size={size} />
          ),
        }}
      />
      <Tab.Screen
        name='Szukaj'
        component={Search}
        options={{
          headerShown: false,
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="magnify" color={color} size={size} />
          ),
        }}
      />
    </Tab.Navigator>
  );
}
//KONIEC

//GLOWNA FUNKCJA
export default function App() 
{
  return (
    <NavigationContainer>
      <MyTabs />
    </NavigationContainer>
  );
}
//KONIEC
